import React from 'react';
import '../styles/Skills.css';

const Skills = () => {
  const skills = [
    { name: 'Java', icon: '‚òï', percentage: 90 },
    { name: 'Python', icon: 'üêç', percentage: 85 },
    { name: 'JavaScript', icon: '‚ö°', percentage: 88 },
    { name: 'Node.js', icon: 'üü¢', percentage: 85 },
    { name: 'React.js', icon: '‚öõÔ∏è', percentage: 80 },
    { name: 'MySQL', icon: 'üóÑÔ∏è', percentage: 90 },
    { name: 'PostgreSQL', icon: 'üêò', percentage: 85 },
    { name: 'Git', icon: 'üì¶', percentage: 88 },
    { name: 'REST APIs', icon: 'üîå', percentage: 92 }
  ];

  return (
    <section id="skills" className="section skills-section">
      <div className="container">
        <h2 className="section-title">Technical Skills</h2>
        <p className="section-subtitle">The tools and technologies I use to bring ideas to life</p>
        
        <div className="skills-grid">
          {skills.map((skill, index) => (
            <div key={index} className={`skill-card fade-in-up delay-${index % 3}`}>
              <div className="skill-header">
                <div className="skill-name">
                  <span className="skill-icon">{skill.icon}</span>
                  {skill.name}
                </div>
                <span className="skill-percentage">{skill.percentage}%</span>
              </div>
              <div className="skill-bar">
                <div 
                  className="skill-progress" 
                  style={{ width: `${skill.percentage}%` }}
                ></div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
